import { Column, Stack, Card, Box, Columns } from 'braid-design-system';
import { Component } from 'react';

export class Game extends Component {
  render() {
    return (
      <div id='gameBoard'>
        <Stack>
          <Box
            background='cautionLight'
            boxShadow='borderCaution'
            style={{ width: '20%', paddingBottom: '15%' }}
          >
            0,0
          </Box>
          <Box
            background='cautionLight'
            boxShadow='borderCaution'
            style={{ width: '20%', paddingBottom: '15%' }}
          >
            1,0
          </Box>
          <Box
            background='cautionLight'
            boxShadow='borderCaution'
            style={{ width: '20%', paddingBottom: '15%' }}
          >
            2,0
          </Box>
          <Box
            background='cautionLight'
            boxShadow='borderCaution'
            style={{ width: '20%', paddingBottom: '15%' }}
          >
            3,0
          </Box>
        </Stack>
      </div>
    );
  }
}
